INSERT INTO `products` (`product_id`, `product_categories_id`, `product_categories`, `product_name`, `product_enabled`, `product_description`, `product_available_quantity`, `product_weight`, `product_price`, `product_sale_price`, `product_image`) VALUES
(35, 10, 'peripherals', 'LIFEVIEW BLUEKY', 1, 'Μαγνητικό πληκτρολόγιο για το ipad σας με ενσωματωμένη μπαταρία. Αλουμινένιο κάλυμμα με δυνατό μαγνήτη. Μπορεί να στηρίξει το ipad σας οριζόντια και κάθετα. Με ενσωματωμένο έξυπνο κάλυμμα που ανοιγοκλείνει το ipad σας αυτόματα για εξοικονόμηση ενέργειας.', 15, 1, 28, 39, );
INSERT INTO `products` (`product_id`, `product_categories_id`, `product_categories`, `product_name`, `product_enabled`, `product_description`, `product_available_quantity`, `product_weight`, `product_price`, `product_sale_price`, `product_image`) VALUES
(36, 10, 'peripherals', 'LOGITECH 967685', 1, 'Το Logitech diNovo Edge είναι ενα νέο πληκτρολόγιο με την τεχνολογία και την ποιότητα κατασκευής που υπόσχεται η κατασκευάστρια εταιρία Logitech. Ο πολύ κομψός σχεδιασμός του σίγουρα δεν θα το αφήσει να περάσει απαρατήρητο. Χρησιμοποιεί την τεχνολογία Bluetouth για σύνδεση με τον υπολογιστή, η οποία εγγυάται πιο σταθερή και απρόσκοπτη λειτουργία. Επιπλέον έχει πολύ χαμηλούς χρόνους φόρτισης, αφού πέντε λεπτά φόρτισης αντιστοιχούν σε μια μέρα λειτουργίας.', 20, 1, 98, 129, );
INSERT INTO `products` (`product_id`, `product_categories_id`, `product_categories`, `product_name`, `product_enabled`, `product_description`, `product_available_quantity`, `product_weight`, `product_price`, `product_sale_price`, `product_image`) VALUES
(37, 10, 'peripherals', 'COOLERMASTER SGB-3011', 1, 'Το combo πακέτο Devastator περιλαμβάνει το gaming ποντίκι MS2K και το gaming πληκτρολόγιο MB24 που είναι ειδικά σχεδιασμένα για φιλόδοξους gamers. Είναι κατασκευασμένα με τέτοιο τρόπο ώστε να παρέχουν στους παίκτες το αξιόπιστο hardware για να αντέχει στην καθημερινή χρήση. Είναι ο ιδανικός συνδυασμός εργονομικού σχεδιασμού και ακρίβειας αποτελέσματος. Αποτελεί μια προσιτή gaming πρόταση με όλα τα χαρακτηριστικά που χρειάζεστε για να κερδίσετε!', 20, 1, 25, 35, );
INSERT INTO `products` (`product_id`, `product_categories_id`, `product_categories`, `product_name`, `product_enabled`, `product_description`, `product_available_quantity`, `product_weight`, `product_price`, `product_sale_price`, `product_image`) VALUES
(38, 10, 'peripherals', 'MICROSOFT KB 5000', 1, 'Μία ακόμη ενδιαφέρουσα πρόταση της Microsoft είναι το Wireless Mobile Desktop 5000 το οποίο συνδυάζει κομψή εμφάνιση και άνετο, πρακτικότατο σχεδιασμό, εκμεταλλευόμενο ταυτόχρονα τα πλεονεκτήματα της τεχνολογίας BlueTrack και της ασύρματης τεχνολογίας Microsoft 2.4 GHz.', 20, 1, 46, 58, );
INSERT INTO `products` (`product_id`, `product_categories_id`, `product_categories`, `product_name`, `product_enabled`, `product_description`, `product_available_quantity`, `product_weight`, `product_price`, `product_sale_price`, `product_image`) VALUES
(43, 11, 'tablets', 'TABLET INNOVATOR 8', 1, 'Το innovator W808 είναι ένα κομψό tablet ειδικά σχεδιασμένο για να ενισχύσει τον ψηφιακό τρόπο ζωής σας. Διαθέτει IPS οθόνη 8\'\' πολλαπλής αφής με ανάλυση 1280 x 800 pixels για ξεκούραστο Web Browsing, λειτουργικό Windows 8.1 και αποθηκευτικό χώρο 16 GB, που θα χωρέσει πλήθος εφαρμογών, φωτογραφίες, τις ταινίες και αρχεία video/μουσικής σας. Είναι απολύτως παραμετροποιήσιμο ώστε να γίνει το δικό σας entertainment tablet, είτε το χρησιμοποιείτε για σερφάρισμα στο internet είτε ως media και music player!', 5, 1, 95, 111.9, );
